import React from 'react';
import s from './today.module.css'
import { Route, NavLink } from 'react-router-dom';

import Test1 from '../order_Shop/test/test1'
import Test2 from '../order_Shop/test/test2'

let Today_menu = (props) => {
    let path = "/today/" + props.path;
    return (
        <NavLink className={props.clas_es} to={path}><div>{props.name}</div></NavLink>
    )
}
const Today = (props) => {
    let data_today =[
        { path: "order", name: "Заказы" },
        { path: "tehno", name: "Технишн" },
        { path: "bag", name: "Баги" },
        { path: "aktion", name: "Акции" },
        { path: "info", name: "Инфо" },
    ]
    return (
        <div className={s.grid}>
            <div className={s.grid1}>
                <div className={s.nav_grid}>
                    <Today_menu clas_es={s.nav1} path={data_today[0].path} name={data_today[0].name} />
                    <Today_menu clas_es={s.nav2} path={data_today[1].path} name={data_today[1].name} />
                    <Today_menu clas_es={s.nav3} path={data_today[2].path} name={data_today[2].name} />
                    <Today_menu clas_es={s.nav4} path={data_today[3].path} name={data_today[3].name} />
                    <Today_menu clas_es={s.nav5} path={data_today[4].path} name={data_today[4].name} />
                </div>
            </div>
            <div className={s.grid2}></div>
            <div className={s.grid3}>
                <Route path="/today/order" component={Test1} />
                <Route path="/today/bag"   component={Test2} />
            </div>
        </div>
    )
}
export default Today;

























